package net.wanho.vo.customer;

import java.util.Date;

public class CustomerVo {
	private Integer customerId;
	private String name;
	private String customerName;
	private Integer fieldId;
	private Integer sourceId;
	private String fieldName;
	private String sourceName;
	private Date createTime;
	private Date updateTime;
	private String postCode;
	private String busubessVolume;
	private String employeeNumbers;
	private String tag;
	private String remarks;
	private Integer prinpical;
	
	
	

	
	public CustomerVo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public CustomerVo(Integer customerId, String name, String customerName, Integer fieldId, Integer sourceId,
			String fieldName, String sourceName, Date createTime, Date updateTime, String postCode,
			String busubessVolume, String employeeNumbers, String tag, String remarks, Integer prinpical) {
		super();
		this.customerId = customerId;
		this.name = name;
		this.customerName = customerName;
		this.fieldId = fieldId;
		this.sourceId = sourceId;
		this.fieldName = fieldName;
		this.sourceName = sourceName;
		this.createTime = createTime;
		this.updateTime = updateTime;
		this.postCode = postCode;
		this.busubessVolume = busubessVolume;
		this.employeeNumbers = employeeNumbers;
		this.tag = tag;
		this.remarks = remarks;
		this.prinpical = prinpical;
	}

	public Integer getCustomerId() {
		return customerId;
	}

	public void setCustomerId(Integer customerId) {
		this.customerId = customerId;
	}

	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getCustomerName() {
		return customerName;
	}
	public void setCustomerName(String customerName) {
		this.customerName = customerName;
	}
	public String getFieldName() {
		return fieldName;
	}
	public void setFieldName(String fieldName) {
		this.fieldName = fieldName;
	}
	public String getSourceName() {
		return sourceName;
	}
	public void setSourceName(String sourceName) {
		this.sourceName = sourceName;
	}
	public Date getCreateTime() {
		return createTime;
	}
	public void setCreateTime(Date createTime) {
		this.createTime = createTime;
	}
	public Date getUpdateTime() {
		return updateTime;
	}
	public void setUpdateTime(Date updateTime) {
		this.updateTime = updateTime;
	}
	
	public String getPostCode() {
		return postCode;
	}
	public void setPostCode(String postCode) {
		this.postCode = postCode;
	}
	public String getBusubessVolume() {
		return busubessVolume;
	}
	public void setBusubessVolume(String busubessVolume) {
		this.busubessVolume = busubessVolume;
	}
	public String getEmployeeNumbers() {
		return employeeNumbers;
	}
	public void setEmployeeNumbers(String employeeNumbers) {
		this.employeeNumbers = employeeNumbers;
	}
	public String getTag() {
		return tag;
	}
	public void setTag(String tag) {
		this.tag = tag;
	}
	public String getRemarks() {
		return remarks;
	}
	public void setRemarks(String remarks) {
		this.remarks = remarks;
	}

	public Integer getFieldId() {
		return fieldId;
	}

	public void setFieldId(Integer fieldId) {
		this.fieldId = fieldId;
	}

	public Integer getSourceId() {
		return sourceId;
	}

	public void setSourceId(Integer sourceId) {
		this.sourceId = sourceId;
	}

	public Integer getPrinpical() {
		return prinpical;
	}

	public void setPrinpical(Integer prinpical) {
		this.prinpical = prinpical;
	}

	@Override
	public String toString() {
		return "CustomerVo [customerId=" + customerId + ", name=" + name + ", customerName=" + customerName
				+ ", fieldId=" + fieldId + ", sourceId=" + sourceId + ", fieldName=" + fieldName + ", sourceName="
				+ sourceName + ", createTime=" + createTime + ", updateTime=" + updateTime + ", postCode=" + postCode
				+ ", busubessVolume=" + busubessVolume + ", employeeNumbers=" + employeeNumbers + ", tag=" + tag
				+ ", remarks=" + remarks + ", prinpical=" + prinpical + "]";
	}

	

	
	
	
	
	
	
	
}
